import { GitHub } from "@material-ui/icons";
import MailOutlineIcon from '@material-ui/icons/MailOutline';
import { mdiLanguageTypescript, mdiReact } from '@mdi/js';
import { mdiMaterialUi } from '@mdi/js';


const links = [
  {
    label: 'Github',
    link: 'https://github.com/jswelsh',
    icon: <GitHub />
  },
  {
    label: 'Email',
    link: 'mailto:james.sinclair.welsh@gmail.com',
    icon: <MailOutlineIcon/>
  }
]

const projects = [
  {
    header: 'CurExC',
    demo: 'https://curexc.web.app/',
    repo: 'https://github.com/jswelsh/currency_converter_v1',
    technologies: [{
        label:'React',
        icon: mdiReact
      }, {
        label: 'Material UI', 
        icon: mdiMaterialUi
      }, {
        label:'TypeScript',
        icon: mdiLanguageTypescript
      }
    ],
    image: null
  }, {
    header: 'TransLink',
    demo: undefined,
    repo: 'https://github.com/jswelsh/translinkGraph',
    technologies: [{
        label:'React',
        icon: mdiReact
      }, {
        label: 'Material UI', 
        icon: mdiMaterialUi
      }, {
        label:'TypeScript',
        icon: mdiLanguageTypescript
      }
    ],
    image: null
  }
];
export { links, projects }
